Alexander H Edwards came to the Sydney bar in 2014 after working as a solicitor at a top-tier commercial firm and as a tipstaff to their Honours Campbell JA (in the Court of Appeal) and R A Hulme J (in the Common Law Division) in the New South Wales Supreme Court.

He maintains a diverse practice and accepts briefs in all areas.  He specialises in complex litigation in the NSW Supreme and Federal Courts and has extensive experience in the conduct of a wide range of class actions, including securities actions, bushfires and statutory claims.  He has also appeared as an Acting Crown Prosecutor briefed by the NSW ODPP and in Coronial inquiries.  He accepts briefs on a pro bono or reduced rates basis from a number of not-for-profit organisations and community legal centres, including Redfern Legal Centre and Salvos Humanitarian.  

As a result, he has expertise in:

● class actions;
● commercial litigation;
● misleading and deceptive conduct (and similar statutory causes);
● common law torts;
● public or administrative law;
● State and Federal serious crime;
● equity and trusts; and
● Coronial proceedings.

